    with open(f"Аптечные сети{date}.csv", 'a', newline='') as file:
        writer = csv.writer(file, delimiter=';')
        writer.writerow(['Дата', 'Наименование препарата как у нас', 'Наименование препарата как у аптеки', 'Наименование АС', 'Ссылка на препарат', 'Город', 'Цена'])
        for item in prep:
            writer.writerow([date, '', item['name'], item["Apteka"], item['link'], citys, item['cost']])